		getDataSourceWithParams: function(rs){
			var ds = new $.ig.RESTDataSource({
				dataSource: this.adventureWorks,
				schema: {
					fields: [
					{
						name: "ProductID",
						dataType: "number"
					},
					{
						name: "Name",
						dataType: "string"
					},
					{
						name: "ProductNumber",
						dataType: "string"
					}]
				},
				restSettings: rs,
				primaryKey: "ProductID"
			});
			return ds;
		},
		logger: function(feature, token, result, expected){
			return feature + (token ? " for " + token : "") + " is: " + result + ". Expected results was: " + expected + "!";
		},
		fictiveSerializer: function(data) {
			$("<div></div>").attr("id", "fictiveSerializer").appendTo(document.body);
			return JSON.stringify(data);
		},
