	// Initialize REST state tests (Init function of the RESTDataSource)
	QUnit.test("est 1.1: init function tests", function (assert) {
		assert.expect(21);
		//check options
		this.feature = "options";
		this.opts = this.ds.settings.restSettings;
		assert.ok(this.opts.create.url === this.rs.create.url, this.logger(this.feature, "create.url", this.opts.create.url, this.rs.create.url));
		assert.ok(this.opts.create.template === null, this.logger(this.feature, "create.template", this.opts.create.template, null));
		assert.ok(this.opts.create.batch === false, this.logger(this.feature, "create.batch", this.opts.create.url, false));
		assert.ok(this.opts.update.url === this.rs.create.url, this.logger(this.feature, "update.url", this.opts.update.url, this.rs.create.url));
		assert.ok(this.opts.update.template === null, this.logger(this.feature, "update.template", this.opts.update.template, null));
		assert.ok(this.opts.update.batch === false, this.logger(this.feature, "update.batch", this.opts.update.url, false));
		assert.ok(this.opts.remove.url === this.rs.create.url, this.logger(this.feature, "remove.url", this.opts.remove.url, this.rs.create.url));
		assert.ok(this.opts.remove.template === null, this.logger(this.feature, "remove.template", this.opts.remove.template, null));
		assert.ok(this.opts.remove.batch === false, this.logger(this.feature, "remove.batch", this.opts.remove.url, false));
		assert.ok(this.opts.encodeRemoveInRequestUri === true, this.logger(this.feature, "encode remove in request", this.opts.encodeRemoveInRequestUri, true));
		assert.ok(this.opts.contentSerializer === null, this.logger(this.feature, "content serializer", this.opts.contentSerializer, null));
		assert.ok(this.opts.contentType === 'application/json; charset=utf-8',
		this.logger(this.feature, "type", this.opts.contentType, 'application/json; charset=utf-8'));
		//check handlers
		this.feature = "handlers";
		assert.ok(typeof (this.ds._okHandler) === 'function', this.logger(this.feature, "ok", typeof (this.ds._okHandler), 'function'));
		assert.ok(typeof (this.ds._createdHandler) === 'function', this.logger(this.feature, "created", typeof (this.ds._createdHandler), 'function'));
		assert.ok(typeof (this.ds._noContentHandler) === 'function', this.logger(this.feature, "nocontent", typeof (this.ds._noContentHandler), 'function'));
		assert.ok(this.ds._httpHandlers["POST"]["201"] === this.ds._createdHandler, 'handler associated correctly');
		assert.ok(this.ds._httpHandlers["PUT"]["200"] === this.ds._okHandler, 'handler associated correctly');
		assert.ok(this.ds._httpHandlers["PUT"]["201"] === this.ds._createdHandler, 'handler associated correctly');
		assert.ok(this.ds._httpHandlers["PUT"]["204"] === this.ds._noContentHandler, 'handler associated correctly');
		assert.ok(this.ds._httpHandlers["DELETE"]["200"] === this.ds._okHandler, 'handler associated correctly');
		assert.ok(this.ds._httpHandlers["DELETE"]["204"] === this.ds._noContentHandler, 'handler associated correctly');
	});

