	QUnit.test("Test 4.3: proper url test", function (assert) {
		assert.expect(10);
		var res;
		this.feature = "Get proper url";
		this.params = {
			create: {
				url: this.tUrl1,
				template: this.tTmpl1,
			},
			update: {
				template: this.tTmpl2,
			},
			remove: {
				url: this.tUrl3,
			}
		}
		this.ds.settings.restSettings = $.extend(true, $.extend(true, {}, empty), this.params);
		this.ds._setLazyUrls();
		res = this.ds._getProperUrl("POST", this.params.create.batch, this.id);
		assert.ok(res[res.length - 1] === "/", "Last symbol of url is '/'");
		res = this.ds._getProperUrl("PUT", this.params.update.batch, this.id);
		assert.ok(res[res.length - 1] === "/", "Last symbol of url is '/'");
		// now check the urls themselves
		res = this.ds._getProperUrl("POST", true, this.id);
		assert.ok(res === this.tUrl1, this.logger(this.feature, "post b url", res, this.tUrl1));
		res = this.ds._getProperUrl("POST", false, this.id);
		assert.ok(res === this.tTmpl1.replace("${id}", this.id), this.logger(this.feature, "post n url", res, this.tTmpl1.replace("${id}", this.id)));
		res = this.ds._getProperUrl("PUT", true, this.id);
		assert.ok(res === this.tUrl3, this.logger(this.feature, "put b url", res, this.tUrl3));
		res = this.ds._getProperUrl("PUT", false, this.id);
		assert.ok(res === this.tTmpl2.replace("${id}", this.id), this.logger(this.feature, "put n url", res, this.tTmpl2.replace("${id}", this.id)));
		res = this.ds._getProperUrl("DELETE", true, this.id);
		assert.ok(res === this.tUrl3, this.logger(this.feature, "delete b url", res, this.tUrl3));
		res = this.ds._getProperUrl("DELETE", false, this.id);
		assert.ok(res === this.tTmpl2.replace("${id}", this.id), this.logger(this.feature, "delete n url", res, this.tTmpl2.replace("${id}", this.id)));
		this.params = {
			remove: {
				template: this.tTmpl3,
			}
		}
		this.ds.settings.restSettings = $.extend(true, $.extend(true, {}, empty), this.params);
		this.ds._setLazyUrls();
		res = this.ds._getProperUrl("DELETE", true, this.id);
		assert.ok(res === null, this.logger(this.feature, "delete b url", res, null));
		res = this.ds._getProperUrl("DELETE", false, this.id);
		assert.ok(res === this.tTmpl3.replace("${id}", this.id), this.logger(this.feature, "delete b url", res, this.tTmpl3.replace("${id}", this.id)));
	});
